@prefix : <http://www.semanticweb.org/ontologies/2021/5/untitled-ontology-13#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:AdministrativeDashboard a owl:Class ;
                        rdfs:label "Administrative Dashboard"@en ;
                        rdfs:comment "The system provides an administrative dashboard for sales analytics"@en ;
                        rdfs:subClassOf :System .

:SalesAnalytics a owl:Class ;
                rdfs:label "Sales Analytics"@en ;
                rdfs:subClassOf :AdministrativeDashboard .

:provides a owl:ObjectProperty ;
            rdfs:domain :System ;
            rdfs:range :AdministrativeDashboard ;
            rdfs:label "provides"@en ;
            rdfs:comment "The system provides an administrative dashboard"@en .
